import React, { useState } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  const [selectedTicket, setSelectedTicket] = useState(null);

  // ... (le reste du code reste identique jusqu'au return)

  return (
    <>
      <IndexNavbar />

      <div style={pageWrapper}>
        <img
          src="https://images.unsplash.com/photo-1605902711622-cfb43c4437d3"
          alt="background"
          style={backgroundImageStyle}
        />

        <div style={glassCard}>
          <h1 style={titleStyle}>üìã Mes Tickets</h1>

          <div style={ticketListStyle}>
            {tickets.map((ticket) => (
              <div key={ticket.id} style={ticketItemStyle}>
                <div style={ticketHeaderStyle}>
                  <h3 style={{ margin: 0 }}>{ticket.sujet}</h3>
                  <span style={statusStyle(ticket.statut)}>{ticket.statut}</span>
                </div>
                <p style={ticketMetaStyle}>
                  üè¢ {ticket.departement} | üìÖ {ticket.date}
                </p>
                <button
                  style={detailButtonStyle}
                  onClick={() => setSelectedTicket(ticket)}
                >
                  üîç
                </button>
              </div>
            ))}
          </div>

          {selectedTicket && (
            <div style={detailOverlayStyle}>
              <div style={detailBoxStyle}>
                <h3 style={{ color: "#0d47a1", fontSize: "2rem" }}>üé´ D√©tails du ticket</h3>
                <div style={detailContentStyle}>
                  <p><strong>Sujet :</strong> {selectedTicket.sujet}</p>
                  <p><strong>D√©partement :</strong> {selectedTicket.departement}</p>
                  <p><strong>Statut :</strong> {selectedTicket.statut}</p>
                  <p><strong>Date :</strong> {selectedTicket.date}</p>
                  <p style={descriptionStyle}><strong>Description :</strong> {selectedTicket.description}</p>
                </div>
                <button 
                  onClick={() => setSelectedTicket(null)} 
                  style={closeButtonStyle}
                >
                  ‚úñ Fermer
                </button>
              </div>
            </div>
          )}
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Nouveaux styles modifi√©s
const detailButtonStyle = {
  position: "absolute",
  right: "1rem",
  bottom: "1rem",
  padding: "0.8rem",
  backgroundColor: "#0d47a1",
  color: "#fff",
  border: "none",
  borderRadius: "50%",
  fontWeight: "600",
  fontSize: "1.2rem",
  cursor: "pointer",
  transition: "all 0.3s ease",
  width: "40px",
  height: "40px",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  boxShadow: "0 4px 12px rgba(13, 71, 161, 0.3)",
  ':hover': {
    transform: "scale(1.1)",
    backgroundColor: "#1565c0",
  },
};

const detailOverlayStyle = {
  position: "fixed",
  top: 0,
  left: 0,
  right: 0,
  bottom: 0,
  backgroundColor: "rgba(0, 0, 0, 0.5)",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  zIndex: 1000,
};

const detailBoxStyle = {
  background: "#ffffff",
  padding: "2.5rem",
  borderRadius: "20px",
  width: "80%",
  maxWidth: "800px",
  position: "relative",
  boxShadow: "0 12px 24px rgba(0, 0, 0, 0.2)",
};

const detailContentStyle = {
  margin: "2rem 0",
  fontSize: "1.1rem",
  lineHeight: "1.6",
};

const descriptionStyle = {
  backgroundColor: "#f8f9fa",
  padding: "1.5rem",
  borderRadius: "10px",
  marginTop: "1rem",
};

const closeButtonStyle = {
  position: "absolute",
  top: "1.5rem",
  right: "1.5rem",
  padding: "0.8rem 1.5rem",
  backgroundColor: "#f44336",
  color: "#fff",
  border: "none",
  borderRadius: "8px",
  cursor: "pointer",
  fontWeight: "600",
  fontSize: "1rem",
  transition: "all 0.3s ease",
  ':hover': {
    backgroundColor: "#d32f2f",
    transform: "translateY(-2px)",
  },
};

// ... (les autres styles restent identiques)

export default MyTickets;
